import React from "react";
import s from"./Navbar.module.css"
import { NavLink } from "react-router-dom";
const Navbar = () =>{
    return (
        <div className={style.navbar}>
         <div className={style.navbarwrapper}>
         <div className={style.navbarmenu}>
            <div> 
            <NavLink to="/main" className = { navData => navData.isActive ? style.active : style.menuitem }>Каталог</NavLink>
            </div>
            <div className={style.menuitem} > Избранное</div>
            <NavLink to="/account" className = { navData => navData.isActive ? style.active : style.menuitem }>Личный кабинет</NavLink>
            <div > 
            <NavLink to="/Support" className = { navData => navData.isActive ? style.active : style.menuitem }>Служба поддержки</NavLink>
            </div>
         </div>
         </div>
        </div>
    );
}

export default Navbar;
